import { useEffect, useState } from "react";

function App() {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("./Rule JSON.json")
      .then((response) => response.json())
      .then((item) => setData(item.data));
  }, []);

  console.log(data);

  return (
    <div>
      {data.map((entry, index) => {
        return (
          <div key={entry.id} className="row">
            <h3>{entry.id}</h3>
            <p>{entry.ruleName}</p>
          </div>
        );
      })}
    </div>
  );
}

export default App;
